import React from "react";
import "./stamp.css";

const App = () => {
  const printers = [
    {
      printer: "Printer C 10",
      size: "10 x 27 mm",
      packaging: "Packaging",
      handle: "E/10",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/printer_c10.png", // Replace with actual image path
    },
    {
      printer: "Printer C 20",
      size: "14 x 38 mm",
      packaging: "Packaging",
      handle: "E/20",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/printer_c20.png", // Replace with actual image path
    },
    {
      printer: "Printer C 30",
      size: "18 x 47 mm",
      packaging: "Packaging",
      handle: "E/30",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/printer_c30.png", // Replace with actual image path
    },
  ];

  return (
    <div className="app">
      {printers.map((printer, index) => (
        <div className="card" key={index}>
          {/* First Column: Image */}
          <div className="card-column image-column">
            <img src={printer.imgSrc} alt={printer.printer} />
          </div>
          {/* Second Column: Brand Name */}
          <div className="card-column brand-column">
            <h3>{printer.printer}</h3>
          </div>
          {/* Third Column: Product Details */}
          <div className="card-column details-column">
            <p>
              <strong>Size of Imprint:</strong> {printer.size}
            </p>
            <p>
              <strong>Packaging:</strong> {printer.packaging}
            </p>
            <p>
              <strong>Colour of Handle:</strong> {printer.handle}
            </p>
            <p>
              <strong>Spare Pad:</strong> {printer.sparePad}
            </p>
            <p>
              <strong>Optional Cover:</strong> {printer.optionalCover}
            </p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default StampPads;
